function RestaurantInfo({name, address, phone}) {

    return (
        <div className="elements-restaurantinfo">
            <h1 style={{fontSize: '5rem'}}>{name}</h1>
            <p style={{fontSize: '2rem'}}>{address}</p>
            <p style={{fontSize: '2rem'}}>{phone}</p>
        </div>
    )
}

export default RestaurantInfo;
